Mark a new contract as persistent contract SimpleStorageContract { string public value; function set(uint256 _value) public { value = _value; }
} function testMarkPersistent() public { // by default the `sender` and the contract itself are persistent assert(cheats.isPersistent(msg.sender)); assert(cheats.isPersistent(address(this))); // select a specific fork cheats.selectFork(mainnetFork); // create a new contract that's stored in the `mainnetFork` storage SimpleStorageContract simple = new SimpleStorageContract(); // `simple` is not marked as persistent assert(!cheats.isPersistent(address(simple))); // contract can be used uint256 expectedValue = 99; simple.set(expectedValue); assertEq(simple.value(), expectedValue); // mark as persistent cheats.makePersistent(address(simple)); // select a different fork cheats.selectFork(optimismFork); // ensure contract is still persistent assert(cheats.isPersistent(address(simple))); // value is set as expected assertEq(simple.value(), expectedValue);
}

