大多数时候，仅仅测试您的智能合约输出是不够的。 为了操纵区块链的状态，以及测试特定的reverts和事件Events，Foundry 附带了一组Cheatcodes。 Cheatcodes允许您更改块号、您的身份等。 它们是通过在特别指定的地址上调用特定函数来调用的：0x7109709ECfa91a80626fF3989D68f67F5b1DD12D。 您可以通过 Forge 标准库的“测试”合约中提供的“vm”实例轻松访问Cheatcodes。 Forge 标准库在以下 section 中有更详细的解释。 让我们为只能由其所有者调用的智能合约编写一个测试。 pragma solidity 0.8.10; import "forge-std/Test.sol"; error Unauthorized(); contract OwnerUpOnly { address public immutable owner; uint256 public count; constructor() { owner = msg.sender; } function increment() external { if (msg.sender != owner) { revert Unauthorized(); } count++; }
} contract OwnerUpOnlyTest is Test { OwnerUpOnly upOnly; function setUp() public { upOnly = new OwnerUpOnly(); } function testIncrementAsOwner() public { assertEq(upOnly.count(), 0); upOnly.increment(); assertEq(upOnly.count(), 1); }
} 如果我们现在运行forge test，我们将看到测试通过，因为OwnerUpOnlyTest是 OwnerUpOnly 的所有者。 $ forge test
