Inside your Foundry project working directory: npm init - Setup your project details as usual. npm install --save-dev hardhat - Install Hardhat. npx hardhat - Setup your Hardhat project as you see fit in the same directory. forge remappings > remappings.txt - You will need to re-run this every time you modify libraries in Foundry. Now you need to make the following changes to your Hardhat project. The following assumes a TypeScript setup: npm install --save-dev hardhat-preprocessor - Details on hardhat-preprocessor Add import "hardhat-preprocessor"; to your hardhat.config.ts file. Ensure the following function is present (you can add it to your hardhat.config.ts file or somewhere else and import it - also ensure import fs from "fs"; is present in the file it is added): function getRemappings() { return fs .readFileSync("remappings.txt", "utf8") .split("\n") .filter(Boolean) // remove empty lines .map((line) => line.trim().split("="));
